    const [quantity, setQuantity] = useState(100);

    return(
        <div id="BuyForm">
            <form >
                <label htmlFor="quantity">Quantity: </label>
                <input type="text" id="quantity"/>
                <input type="submit" value="Buy"/>
            </form>
        </div>
    )
}



export default BuyForm;
